import React from 'react'
import './NavBar.css'
import {Link} from 'react-router-dom'
import { useNavigate } from "react-router-dom";

export default function NavBar() {
    let navigate = useNavigate();
    const linkNames = [
        "Home", "Upload Note", "About Us", "Resources", "Login"
    ]

    const links = linkNames.map(name => {
        return <Link to={"/" + name.replace(/\s/g, '')}>{name}</Link>
    })

    function Loginlink (){navigate("/Login")}

    return(
        <div className="navbar">
            <div className="logo">
                <div className="logo-text">The 
                NoteBank</div>
            </div>
            <div className="links">
                {links}
            </div>
            <div className="user">
                
        <i className="fa-regular fa-circle-user" id='profile' onClick={Loginlink}></i>
            </div>
        </div>
    )
}
